import React from "react";
import { Link } from "react-router-dom";

const Logo = ({ width, link = true }) => {
  const Title = <p style={{ width }}>{`Quincy Johnson`}</p>;

  return (
    <>
      {link ? <Link to="/">{Title}</Link> : Title}
    </>
  );
};

export default Logo;
